import { useNavigate } from 'react-router-dom';

export const Home = () => {
    const navigate = useNavigate();
    const token = localStorage.getItem('token');
    const authorize = fetch("http://localhost:4000/user/verify", {
        method: "GET",
        headers:{
            "Authorization" : `Bearer ${token}`
        }
    })
        .then(res=> {
            if(res.ok){
                console.log('authorization success')
            } else{
                navigate('/login')
;            }
        })
        .catch(error => {
            console.log(error);
        })
    useEffect(() => {
      authorize();
    }, [])
    
  return (
    <div>Home</div>
  )
}
